import React from "react";

const LaunchItem = (props) => {
  return (
    <div className="container text-start bg-dark text-warning" style={{ marginTop: "70px" }}>
      <div className="card" style={{ width: "400px",height: "450px" }}>
        <img
          className="card-img-top"
          src={props.img}
          alt="Card image"
          style={{ width: "340px",height: "250px"}}
        />
        <div className="card-body">
          <h4 className="card-title">{props.name}</h4>
          <p className="card-text">
            {props.details === null
              ? "CRS-1 successful, but the secondary payload was inserted into abnormally low orbit and lost due to F"
              : props.details.slice(0, 100)}
          </p>
          <a href="#" className="btn btn-primary mb-0">
            See Profile
          </a>
        </div>
      </div>
      <br />
    </div>
  );
};

export default LaunchItem;
